window.bookSummaryJSON = "<p><b>The skeletons in their closet opened the door and escaped with a vengeance.</b></p> <p>A relationship with three men sounded like a fantasy to Rain Carter once upon a time, but now, she couldn't imagine her life any other way. Warren, Ezra, Graham, and Rain are in perfect sync.</p> <p>Until the woman in black returns.</p> <p>When she reveals the truth about Warren’s past, and how it collides with Rain’s, their perfect fairytale shatters.</p> <p>Once lovers, now enemies, the quad must band together to fight their shared demons...</p> <p>And hope to hell and back that they can escape the cold grasp of their deepest failures.</p>"; 
